import React, { useState } from 'react';
import { AiOutlineClose, AiOutlineMenu } from 'react-icons/ai';
import Logo from '../images/athena-high-resolution-logo-transparent.png'
import { Link } from 'react-router-dom';
const Navbar = () => {
  const [nav, setNav] = useState(false);

  const handleNav = () => {
    setNav(!nav);
  };

  return (
    <div className='flex justify-between items-center h-18 max-w-[2000px] mx-auto px-25 text-black bg-white'>
      {/* Logo Section */}
      <div className="flex items-center">
        <Link to='/'>
        <img src={Logo} alt="Logo" className="items-center h-12 w-auto mr-4" />
        </Link>

      </div>
      <ul className='hidden md:flex'>
        <li className='p-4'>Home</li>
        <li className='p-4'>Features</li>
        <li className='p-4'>Resources</li>
        <li className='p-4'>About</li>
        <li className='p-4'>Contact</li>
      </ul>
      <div onClick={handleNav} className='block md:hidden'>
          {nav ? <AiOutlineClose size={20}/> : <AiOutlineMenu size={20} />}
      </div>
      <ul className={nav ? 'fixed left-0 bottom-0 w-[60%] h-full bg-white ease-linear duration-200' : 'ease-linear duration-500 fixed left-[-100%]'}>
      <img src={Logo} alt="Logo" className="h-12 w-auto mr-4 font-bold" />
          <li className='p-4 border-b '>Home</li>
          <li className='p-4 border-b '>Company</li>
          <li className='p-4 border-b'>Resources</li>
          <li className='p-4 border-b'>About</li>
          <li className='p-4'>Contact</li>
      </ul>
    </div>
  )
};

export default Navbar;
